import React, { Component } from "react";
import "./header.css";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <div>
          <img src="https://placeholder.com/wp-content/uploads/2018/10/placeholder.com-logo3.jpg" alt=""/>
          <ol style={{ display: "flex", flexDirection: "row" }}>
            <li>Home</li>
            <li>Blog</li>
            <li>About</li>
            <li>Contact</li>
          </ol>
        </div>
      </div>
    );
  }
}

export default Header;
